><br />Thank you for signing up with {site_name}! Your account has been approved and is now active.<br /><br />To login please visit the following url:<br /><br />{login_url}<br /><br />Your account e-mail: {email}<br />Your account username: {username}<br />Set your account password: {password_reset_link}<br /><br />If you have any problems, please contact us at {admin_email}<br /><br />Thanks,<br />{site_name}";s:17:"rejected_email_on";b:0;s:18:"rejected_email_sub";s:30:"Your account has been rejected";s:14:"rejected_email";s:288:"Hi {display_name},<br /><br />Thank you for applying for membership to {site_name}! We have reviewed your information and unfortunately we are unable to accept you as a member at this moment.<br /><br />Please feel free to apply again at a future date.<br /><br />Thanks,<br />{site_name}";s:17:"inactive_email_on";b:1;s:18:"inactive_email_sub";s:33:"Your account has been deactivated";s:14:"inactive_email";s:250:"Hi {display_name},<br /><br />This is an automated email to let you know your {site_name} account has been deactivated.<br /><br />If you would like your account to be reactivated please contact us at {admin_email}<br /><br />Thanks,<br />{site_name}";s:17:"deletion_email_on";b:1;s:18:"deletion_email_sub";s:29:"Your account has been deleted";s:14:"deletion_email";s:355:"Hi {display_name},<br /><br />This is an automated email to let you know your {site_name} account has been deleted. All of your personal information has been permanently deleted and you will no longer be able to login to {site_name}.<br /><br />If your account has been deleted by accident please contact us at {admin_email} <br />Thanks,<br />{site_name}";s:16:"resetpw_email_on";b:1;s:17:"resetpw_email_sub";s:19:"Reset your password";s:13:"resetpw_email";s:303:"Hi {display_name},<br /><br />We received a request to reset the password for your account. If you made this request, click the link below to change your password:<br /><br />{password_reset_link}<br /><br />