(1, 1, '2022-09-26 15:18:19', '2022-09-26 15:18:19', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2022-09-26 15:18:19', '2022-09-26 15:18:19', '', 0, 'http://localhost/online%20job%20portal3/?p=1', 0, 'post', '', 1),
(2, 1, '2022-09-26 15:18:19', '2022-09-26 15:18:19', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://localhost/online%20job%20portal3/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2022-09-26 15:18:19', '2022-09-26 15:18:19', '', 0, 'http://localhost/online%20job%20portal3/?page_id=2', 0, 'page', '', 0),
